import { Buffer } from 'buffer';
import * as oasis from 'oasis-std';
export class Greeted implements oasis.AbiEncodable {
    public from: oasis.Address;
    public to: string;
    public constructor(fields: { from: oasis.Address; to: string }) {
        this.from = fields.from;
        this.to = fields.to;
    }
    public abiEncode(encoder: oasis.Encoder) {
        oasis.abiEncode(oasis.Address as oasis.Schema, this.from, encoder);
        oasis.abiEncode('string' as oasis.Schema, this.to, encoder);
    }
    public static abiDecode(decoder: oasis.Decoder): Greeted {
        return new Greeted({
            from: oasis.abiDecode(oasis.Address as oasis.Schema, decoder),
            to: oasis.abiDecode('string' as oasis.Schema, decoder),
        });
    }
    public static async subscribe(
        gateway: oasis.Gateway,
        address: oasis.Address | null,
        topics?: { from?: oasis.Address; to?: string },
    ): Promise<oasis.Subscription<Greeted>> {
        const encodedTopics = [oasis.encodeEventTopic('string', Greeted.name)];
        if (topics?.hasOwnProperty('from')) {
            encodedTopics.push(
                oasis.encodeEventTopic(oasis.Address, topics.from),
            );
        }
        if (topics?.hasOwnProperty('to')) {
            encodedTopics.push(oasis.encodeEventTopic('string', topics.to));
        }
        return gateway.subscribe(
            address,
            encodedTopics,
            async (payload: Uint8Array) => {
                return oasis.abiDecode(Greeted, payload);
            },
        );
    }
}
export class Greeter {
    public static BYTECODE =
        '';
    private constructor(
        readonly address: oasis.Address,
        private gateway: oasis.Gateway,
    ) {}
    public static async connect(
        address: oasis.Address,
        gateway: oasis.Gateway,
    ): Promise<Greeter> {
        return new Greeter(address, gateway);
    }
    public static async deploy(
        gateway: oasis.Gateway,
        { greeting }: { greeting: string },
        options?: oasis.DeployOptions,
    ): Promise<Greeter> {
        const payload = Greeter.makeDeployPayload(greeting);
        try {
            const deployedAddr = await gateway.deploy(payload, options);
            return new Greeter(deployedAddr, gateway);
        } catch (e) {
            throw e;
        }
    }
    private static makeDeployPayload(greeting: string): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8Array(Buffer.from(Greeter.BYTECODE, 'base64'));
        return oasis.abiEncode(['string' as oasis.Schema], [greeting], encoder);
    }
    public async greet(
        { name }: { name: string },
        options?: oasis.RpcOptions,
    ): Promise<string> {
        const payload = Greeter.makeGreetPayload(name);
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return oasis.abiDecode('string' as oasis.Schema, res);
        } catch (e) {
            throw e;
        }
    }
    private static makeGreetPayload(name: string): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(0);
        return oasis.abiEncode(['string' as oasis.Schema], [name], encoder);
    }
    public async getGreeted(
        options?: oasis.RpcOptions,
    ): Promise<oasis.Set<string>> {
        const payload = Greeter.makeGetGreetedPayload();
        try {
            const res = await this.gateway.rpc(this.address, payload, options);
            return oasis.abiDecode(['Set', 'string'] as oasis.Schema, res);
        } catch (e) {
            throw e;
        }
    }
    private static makeGetGreetedPayload(): Buffer {
        const encoder = new oasis.Encoder();
        encoder.writeU8(1);
        return encoder.finish();
    }
}
